INSERT INTO `forum` (`forum_id`, `forum_name`, `forum_email`, `forum_website`, `forum_subject`, `forum_threadtag`, `forum_threadid`, `forum_content`, `forum_subdate`, `forum_updatedate`, `forum_delete`, `forum_views`, `forum_site`, `forum_notme`, `forum_moderation`) VALUES
(107, 'TimB', 'tdburnett@hotmail.com', '', '', 0, 163289728, 'Message from Mary: \r\n\r\nTopper 41631 FOR SALE\r\n> £750. You can contact them at Email: Margeo3636@yahoo.co.uk, Telephone: 01132583124', '2009-06-12 17:00:33', '2009-06-12 17:00:33', 1, 0, 'YSC', 0, 'yes'),
(108, 'Fozzy', 'eieieie2003@yahoo.co.uk', '', 'Dinghy wanted.', 1, 163592118, 'Hi all,\r\nNew club member here looking for his first dinghy.\r\nNot sure what I want yet but must have a launch trolly / be in good,watertight condition / ready to sail and under £1000\r\n\r\nAlso I would be grateful for any advice as to what boat I should be chasing and what to stay away from.\r\n\r\neieieie2003@yahoo.co.uk\r\n\r\n\r\n', '2009-06-14 10:15:18', '2009-07-01 23:55:05', 0, 1, 'YSC', 0, 'no'),
(109, 'RichardB', 'richarddbarker@hotmail.com', '', '', 0, 163592118, 'Fozzy, it would be useful if you could provide a bit more information about your requirements. For example do you want a single hander or a boat for family/friends, something that\'s steady to learn in or something challenging to sail from the off.', '2009-06-23 11:22:21', '2009-06-23 11:22:21', 0, 0, 'YSC', 0, 'no'),
(110, 'TOPTOPPER (Guest)', 'john.horton@bettysandtaylors.co.uk', '', 'Streaker Nationals July 2009', 1, 164457599, 'Hi there - message to all you Streaker sailors - The nationals this year are being held at Lancing SC ( down on the south coast ) on week-end of 18/19 July 2009, if anybody is interested in going down to this event LSC membership secretary Jerry Hone can provide you with more info etc - Jerry can be contacted on memsec@lancingsc.org.uk \r\nWhen I sailed a Streaker back in 1993 I went to the nationals at Lancing & was made to feel very welcome by Lancing SC.\r\nGo on give it a try - you might like it.\r\nChange of tack slightly - many thanks to fellow club members for their running of the Topper open - I had a great day & it was so good to have the opportunity to sail against other keen Topper sailors - Many thanks again for such a nice day. John T22237    \r\n ', '2009-06-24 10:39:59', '2009-06-24 10:39:59', 0, 0, 'YSC', 0, ''),
(106, 'JohnS (Commodore)', 'john.simms7@ntlworld.com', '', '', 0, 163289728, 'Amanda,\r\nToppers are fairly tough little boats, but you just need to be careful about what you get for your money - it may seem good value but if it\'s likely to need a new mast or boom in the near future you\'d have to take that into account.\r\n\r\nPrice will depend on age and what \"extras\" come with it - sails, covers, trolleys and so on - it depends what you want from the boat.\r\n\r\nThere\'s quite a number of us at the club that have experience of Toppers and would be more than happy to give you a few pointers - just ask around at the club - I should be up next tuesday if it will help.\r\n\r\nThere is also a useful bit on the Topper website about what to look for in 2nd hand toppers - might be worth having a look at that\r\n\r\nAll the best\r\n\r\nJohn', '2009-06-11 22:00:09', '2009-06-11 22:00:09', 0, 0, 'YSC', 0, 'no'),
(104, 'TimB', 'tdburnett@hotmail.com', '', '', 0, 163289728, 'Chech', '2009-06-10 22:16:04', '2009-06-10 22:16:04', 1, 0, 'YSC', 0, 'no'),
(105, 'IanE', 'eeglen@toucansurf.com', '', '', 0, 163289728, 'Amanda \r\n\r\nI have a topper & launching trolley for sale.  I am asking £350-£400.  The topper is currently at YSC.  If you are interested send me your email address & I\'ll send some photos I took last week or you can ring me on 01274 596201.  \r\n\r\nIan \r\neeglen@toucansurf.com', '2009-06-11 18:29:28', '2009-06-11 18:29:28', 0, 0, 'YSC', 0, 'no'),
(103, 'TimB', 'tdburnett@hotmail.com', '', 'Topper Advice', 1, 163289728, 'enquiry from: Amanda. They ask: Hi, I\'ve recently undertaken RYA L1 & L2 on the Tarn and been upto the last YSC Tuesday Training sessions (which have been great fun!).  I have the joining papers and intend to join next Tuesday.\r\n> I greatly enjoy sailing in multi-person boats but fancy having a little boat to jump in, this leads me on to my actual query:\r\n> I\'ve seen a Topper on eBay that looks like good value, however its in Warrington and doesn\'t have a road trailer, just a launching trailer, would anyone be able to lend me a trailer so i would be able to purchase such a boat and does £575-£875 for a Topper sound like value??  \r\n> I am hoping to be a member and store my future boat at the Tarn.  Any advice you could give would be really appreciated.\r\n', '2009-06-10 22:15:28', '2009-09-24 21:14:35', 0, 185, 'YSC', 0, 'no'),
(77, 'TimB', 'tdburnett@hotmail.com', '', 'Tim B AOD Swap - April 4th', 1, 155582191, 'Can anyone swap the AOD for the 4th April, I\'m on a stag do.', '2009-03-13 17:16:31', '2009-03-13 17:16:31', 0, 120, 'YSC', 0, 'no'),
(78, 'PatrickG', 'patrick@eldwick.org.uk', '', 'AOOD swap for Wed 3 June', 1, 158845478, 'D Girt has let me know that he can\'t do the duty on 3 June.  If you would like to swap contact him directly to discuss details.', '2009-04-20 11:44:38', '2009-04-20 22:11:42', 0, 1, 'YSC', 0, 'no'),
(79, 'TimB', 'tdburnett@hotmail.com', '', '', 0, 158845478, 'Hi, I owe an AOOD so am willing to cover but I don\'t his details. Tim B', '2009-04-20 21:54:40', '2009-04-20 21:54:40', 0, 0, 'YSC', 0, 'no'),
(45, 'John S (2) (Guest)', 'john.simms7@ntlworld.com', '', 'Winter Sailing', 1, 149505472, 'Happy New Year to everyone. The New Years Dat racing was, how shall we say, tactical - but there was a good laser turnout for the event.\r\n\r\nIf anyone fancies sailing through the winter, there are a few local open series available - Yorkshire Dales, West Riding and I believe Scammonden (although I\'ve not seen it advertised this year).\r\n\r\nA number of the Lasers will be sailing at Yorkshire Dales, where the Laser fleet is making a bit of a comeback. 2 races each day (Sunday)first race at 11.30, running through Jan & Feb at a cost of £10 for the series, and you\'ll be able to leave your boat there.\r\n\r\nStarts this weekend - good to see you there if you can make it\r\n\r\nBest Regards\r\n\r\nJohn \r\n\r\n', '2009-02-12 21:56:37', '2009-02-12 21:56:37', 0, 1, 'YSC', 0, 'no'),
(46, 'TOPTOPPER (Guest)', 'john.horton@bettysandtaylors.co.uk', '', 'membership enquiry', 1, 150497228, 'Hi there - Happy New Year. Could you possibly send me Rob Crosslands e mail address as I would like to discuss with\r\nhim the possibility of changing my current single status membership to family membership. I need the details &\r\ncosts etc from him so that I can weigh up the pro`s & cons. Many thanks & kind regards. John Horton. jph237  ', '2009-02-10 21:56:37', '2009-02-10 21:56:37', 0, 1, 'YSC', 0, 'No'),
(73, 'TimB', 'tdburnett@hotmail.com', '', '', 0, 153617475, 'I believe that it will be sent shortly along with the most recent newsletter.\r\n\r\nTim', '2009-03-05 22:20:30', '2009-03-05 22:20:30', 0, 0, 'YSC', 0, 'no'),
(74, 'TimB', 'tdburnett@hotmail.com', '', '', 0, 153617475, 'Hi, due to printing delays I have added uploaded the programme:\r\n\r\nhttp://www.yeadonsailingclub.co.uk/pdfs/2009_YSC_Race_Diary_white2.pdf\r\n\r\nhttp://www.yeadonsailingclub.co.uk/pdfs/2009_YSC_Race_Diary_white.pdf', '2009-03-08 20:17:57', '2009-03-08 20:17:57', 0, 0, 'YSC', 0, 'no'),
(75, 'TimB', 'tdburnett@hotmail.com', '', 'Streaker forsale', 1, 155318740, 'Hi We have a 2008 butler built Streaker for sale Only sailed 4-5 times due to my husbands ill health It is advertised on Apollo duck and Dtreaker assoc website could you pass this onto your members please thank you.\r\n\r\nhttp://sailingdinghies.apolloduck.co.uk/listings.phtml?cid=125', '2009-03-10 16:05:40', '2009-03-10 16:05:40', 0, 166, 'YSC', 0, 'no'),
(76, 'AndrewC', 'a.r.cowling@blueyonder.co.uk', '', 'OOD swap', 1, 155427011, 'Does anybody want to swop OOD duty for Sunday 30th August? ', '2009-03-11 22:10:11', '2009-03-11 22:10:11', 0, 115, 'YSC', 0, 'no'),
(53, 'David HINKS (Guest)', 'davidjhinks@btinternet.com', '', 'Denis and Jo\'s Winter walk', 1, 151527250, 'Thanks to Denis for arranging the walk round Ogden Reservoir. A thankyou too for waiting for me (I was a little bit late, I always get lost in Bradford!) There was lots to see, tremendous views. lots of pics were taken, perhaps someone will be along in a while with the results .  Thanks again\r\nDavid Hinks  ', '2009-02-04 21:56:37', '2009-02-04 21:56:37', 0, 0, 'YSC', 0, ''),
(54, 'HowardC', 'hchadwick2@talktalk.net', '', 'Sailing Programme', 1, 153617475, 'Hi all\r\nSoon be time to go sailing again, sorry to miss the warm up day but we are off to an open meeting on the Tyne on the 22nd.  When will we have sight of the sailing programme please so that we can check our OOD duties etc?  Howard C.', '2009-01-04 21:56:37', '2009-03-08 20:17:57', 0, 1, 'YSC', 0, 'no'),
(55, 'TimB', 'tdburnett@hotmail.com', '', 'Cruising Conference - Saturday 14th March', 1, 154815100, 'http://www.manca.org.uk/nwconference.htm\r\n\r\nCruising boats have changed and people are regularly cruising areas that few had considered a decade or two ago. Navigation now, for many sailors, is electronic and the old skills may be there only as rusty backups. Weather forecasts have improved and are available almost anywhere any time. On the other hand, environmental demands on the sailing community have increased and there is always the prospect, for better or worse, of tightening legislation.\r\n\r\nThe conference will explore some of these themes with plenty of opportunity for discussion and a chance to feed some of your thoughts into the RYA.', '2009-03-04 21:56:37', '2009-03-04 21:56:37', 0, 98, 'YSC', 0, 'no'),
(111, 'Nell&Phil(Guest)', 'helen.graham88@hotmail.co.uk', '', '', 0, 163592118, 'Have you seen our Miracle?  There\'s an advert on the notice board.  It\'s really a 2 hander but you can sail it single handed.  It\'s a great little learning boat - quite light,but it\'s very frustrating to race as it\'s slow.  OK, it\'s in need of a bit of TLC but last time it was sailed it was water tight - it does need new sails, but it has a trolley and trailer (a bit big and wide but it works) Only seiing it because N doesn\'t sail any more and it hasn\'t been used for 3 years.  We\'re happy to let you have a go at it. It\'s CHEAP - make an offer!  Have a word with Phil when you see him around - he sails a Laser.  ', '2009-07-01 23:54:34', '2009-07-01 23:54:34', 0, 0, 'YSC', 0, 'No'),
(112, 'Nell&Phil(Guest)', 'helen.graham88@hotmail.co.uk', '', '', 0, 163592118, 'Have you seen our Miracle?  There\'s an advert on the notice board.  It\'s really a 2 hander but you can sail it single handed.  It\'s a great little learning boat - quite light,but it\'s very frustrating to race as it\'s slow.  OK, it\'s in need of a bit of TLC but last time it was sailed it was water tight - it does need new sails, but it has a trolley and trailer (a bit big and wide but it works) Only seiing it because N doesn\'t sail any more and it hasn\'t been used for 3 years.  We\'re happy to let you have a go at it. It\'s CHEAP - make an offer!  Have a word with Phil when you see him around - he sails a Laser.  ', '2009-07-01 23:55:05', '2009-07-01 23:55:05', 0, 0, 'YSC', 0, 'No'),
(113, 'TOPTOPPER (Guest)', 'john.horton@bettysandtaylors.co.uk', '', 'F W Leeks trophy 2009', 1, 166198399, 'Hi there Patrick.\r\n\r\nWould it be possible to post somewhere on the YSC website the final positions of those who competed in the F W Leeks trophy race. I am pretty certain Bill Wilson won but it would be good to see the final outcome for the rest of us.\r\nAlso would it be possible for the future to post up the final results for the other trophy races as they are completed over the rest of the season.\r\n\r\nMany thanks\r\n\r\nJohn\r\nT22237  ', '2009-07-14 14:13:19', '2009-07-14 14:13:19', 0, 0, 'YSC', 0, 'No'),
(114, 'TimB', 'tdburnett@hotmail.com', '', 'Wind Surf Boards', 1, 166998229, 'I\'ve been contacted by a chap who has wind surfing equipment:\r\n\r\n\"i have 3 wind surfing boards, used but in good condition with all of the parts,(Some minor repair work may be needed) If you are interested please note they are free. Look forward to hearing from you soon.\"\r\n\r\nIf you interested then please contact me for more information. Members only, my email address can be found in the members directory. \r\n\r\nTim B', '2009-07-23 20:23:49', '2010-07-15 02:54:41', 0, 61, 'YSC', 0, 'no'),
(115, 'TOPTOPPER (Guest)', 'john.horton@bettysandtaylors.co.uk', '', 'images', 1, 168252770, 'Hi there Patrick - hope you are well - have`nt seen you on the water for a while - you need to be careful on this or you might go across to the dark side & become a landlubber !!.\r\nSad question is this one - would you know if there are any digi images of \r\nme T22237 or of my son T28456 sailing on the tarn - did anybody take images at this year`s Topper open. I am in the process of putting together an album of all the sailing activities that i`ve done over the years & believe it or not I can only find one image of me sailing from years ago that John Southall took of my old Mirror dinghy. \r\nMany thanks for anything that you might be able to come up with.\r\nJohn Horton T22237  ', '2009-08-07 08:52:50', '2009-08-07 08:52:50', 0, 0, 'YSC', 0, 'No'),
(116, 'simon broome', 'simonbroome@sky.com', '', 'boat for sale', 1, 168383028, 'topper topaz uno race + for sale £2100', '2009-08-08 21:03:48', '2009-08-08 21:03:48', 0, 43, 'YSC', 0, 'no'),
(135, 'Andrew Pike', '', '', 'AOD Duty swap', 1, 169928359, 'I can\'t do my AOD duty on 12/9, apologies.  I could do 19/9, 20/9, 26/9, 27/9, 3/10, 4/10, 17/10 or 18/10.', '2009-08-26 18:19:19', '2009-08-26 18:20:08', 0, 7, 'YSC', 0, 'no'),
(117, 'Harry Ashurst (Guest)', 'harry@ashurstn.fsnet.co.uk', '', 'Graduate for sale', 1, 168821164, 'Graduate for sale Reasonable condition great boat with 2 sets of sales Any Offers considered', '2009-08-13 22:46:04', '2009-08-13 22:46:04', 0, 13, 'YSC', 0, 'no'),
(136, 'andrew pike,', '', '', '', 0, 169928359, 'and my email is andrew.pike@hammonds.com', '2009-08-26 18:20:08', '2009-08-26 18:20:08', 0, 0, 'YSC', 0, 'no'),
(137, 'ChrisPark', '', '', 'Hello, I\'m ChrisPark', 1, 170580314, 'Hello. My name is Chris. I\'m from USA. I\'m new here, my friend Matt sent me here. And yeah, hope to be a long time member of this forum! \r\n\r\nHere\'s a photo of me :) http://lmageshack.us/img/chrisP.jpg  - Just so you know who i am! feel free to post your own photos please! :)', '2009-09-03 07:25:14', '2009-09-03 07:25:14', 1, 1, 'YSC', 0, ''),
(141, 'Jaretly', '', '', 'Can someone help .', 1, 173784378, 'I have a nextel sprint mix and they only make one phone that will work with this service. I as wondering if my sim card and service will work with the iphone clones that they sell on the internet...\r\n\r\n\r\n\r\n________________\r\n <a href=http://www.youtube.com/watch?v=EpZmDnMZahc>iphone 3g</a> ', '2009-10-10 09:26:18', '2009-10-10 09:26:18', 1, 1, 'YSC', 0, ''),
(151, 'Jaretly', '', '', 'How do i transer pictures from my iphone 3g to my', 1, 175255860, 'My sprint contract expires at the end of this month and I\'m planning to switch providers to be able to get a cool phone. I\'m stuck deciding between the iPhone 3G or the Blackberry Storm. I\'ve looked at several reviews on youtube but I\'d like to get feedback from the general public that uses either one of these devices. Has anyone experienced any problems with either phone that would make you not recommend it?\r\n\r\n\r\n\r\n________________\r\n <a href=http://www.youtube.com/watch?v=EpZmDnMZahc>unlock iphone 3g</a> ', '2009-10-27 10:11:00', '2009-10-27 10:11:00', 1, 0, 'YSC', 0, ''),
(166, 'John Horton', '', '', 'photo`s', 1, 176507332, 'Hi there - any chance of having posted up on to the gallery some more recent images of us Topper sailors in our boats, there must be quite a few to choose from as numerous piccys have been taken this year over the various series events. Many thanks - John \r\nT22237 & T 28456 ', '2009-11-10 21:48:52', '2009-11-10 21:48:52', 0, 15, 'YSC', 0, 'no');
